CREATE TABLE IF NOT EXISTS "avocado_prices" (
    "id" INT,
    "date" TIMESTAMP,
    "average_price" NUMERIC(3, 2),
    "total_volume" NUMERIC(9, 2),
    "total_bags" NUMERIC(9, 2),
    "small_bags" NUMERIC(9, 2),
    "large_bags" NUMERIC(8, 2),
    "xlarge_bags" NUMERIC(7, 2),
    "type" TEXT,
    "year" INT,
    "region" TEXT
);
